import React from 'react';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';

const ControlEstadisticas = () => {
  const cardStyle = {
    borderRadius: '20px', // Bordes redondeados
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: '10px',
    marginBottom: '20px'
  };

  const buttonStyle = {
    marginLeft: '10px', // Espacio entre los botones
  };

  return (
    <Card style={cardStyle}>
      <CardContent style={{ display: 'flex', alignItems: 'center' }}>
        <img src="images/estadisticasIcn.svg" alt="Estadísticas" style={{ width: '35px', marginRight: '10px' }} />
        <Typography style={{ color: '#DA291C' }}>
          Estadísticas
        </Typography>
      </CardContent>
      <div>
        <Button variant="contained" style={buttonStyle}>
          <img src="images/pdfIcon.svg" alt="PDF" style={{ marginRight: '5px' }} />
          Generar PDF
        </Button>
        <Button variant="contained" style={buttonStyle}>
          <img src="images/csvIcon.svg" alt="CSV" style={{ marginRight: '5px' }} />
          Generar CSV
        </Button>
        <Button variant="contained" style={buttonStyle}>
          <img src="images/barrasIcon.svg" alt="Barras" style={{ marginRight: '5px' }} />
          Maestro Barras
        </Button>
        <Button variant="contained" style={buttonStyle}>
          <img src="images/datosIcon.svg" alt="Datos" style={{ marginRight: '5px' }} />
          Ver Datos
        </Button>
      </div>
    </Card>
  );
};

export default ControlEstadisticas;
